import React from 'react';
import { useEventContext } from '../contexts/EventContext';
import AutonomousDrivingCard from '../components/AutonomousDrivingCard';
import ParkingUpdateCard from '../components/ParkingUpdateCard';
import SafetyInspectionCard from '../components/SafetyInspectionCard';
import WeatherAlertCard from '../components/WeatherAlertCard';
import InteractionHistory from '../components/InteractionHistory';
import './HomePage.css';

const HomePage = () => {
  const { state } = useEventContext();
  const { events } = state;

  return (
    <div className="homepage">
      <header className="homepage-header">
        <h1>Smart City Management Dashboard</h1>
        <p>Real-time monitoring and management of city services</p>
      </header>
      <main className="main-content">
        <div className="card-grid">
          <AutonomousDrivingCard />
          <ParkingUpdateCard />
          <SafetyInspectionCard />
          <WeatherAlertCard />
        </div>
        <InteractionHistory events={events} />
      </main>
    </div>
  );
};

export default HomePage;
